import React from "react";
import ReactDOM from 'react-dom';
import './index.css';
import Cookies from "js-cookie";

import{
BrowserRouter as Router,
Routes,
Route,
} from "react-router-dom"

import OfertAdd from "./Ofert/OfertAdd"
import CategoriesAdd from "./Category/CategoriesAdd"
import Hello from "./Hello";
import Register from "./Register";
import Login from "./Login";
import Error from "./Error";
import CategoryOption from "./Category/CategoryOption";
import OfertSelect from "./Ofert/OfertSelect";
import Navbar from "./Navbar";
import CategoriesSelect from "./Category/CategoriesSelect";
import OfertSelectByID from "./Ofert/OfertSelectByID";

function App(){

    const [auth, setAuth] = React.useState(false);

    const readCookie = () => {
      const user = Cookies.get("name");
      if(user){
        setAuth(true);
      }
    }

    React.useEffect(() => {
      readCookie();
    },[])


    return(

      <Router>
        <Navbar /><Hello login={"ee "+auth} /> 
        <Routes>
          <Route exact path='/' element={<div className="container"> {auth ? <Error /> :<Register />}</div>} />
          <Route path={'/login'} element={<div className="container"><Login /></div> } />
          <Route path={'/register'} element={<div className="container"><Register /></div> } />
          <Route path={'/Ofert'} element={<div className="container"><OfertAdd /><OfertSelect /></div> } />
          <Route path={'/OfertInfo'} element={<div className="container"><CategoryOption /></div> } />
          <Route path={'/Category'} element={<div className="container"><CategoriesAdd /><CategoriesSelect /><OfertSelectByID /></div> } />
          <Route path='*' element={<Error /> } />
        </Routes>
        </Router>);


  }

ReactDOM.render(<App/>,document.getElementById('root'));
